import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import ThemeToggle from './ThemeToggle';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const isActive = (path) => location.pathname === path;

  return (
    <nav className="sticky top-0 z-50 px-4 border-b shadow-md backdrop-blur-md navbar bg-base-100/95 border-base-300 lg:px-8">
      {/* Left Side - Logo & Brand */}
      <div className="navbar-start">
        <div className="flex gap-3 items-center">
          <button
            onClick={() => navigate('/')}
            className="flex gap-3 items-center transition-opacity hover:opacity-80"
          >
            <div className="flex justify-center items-center w-12 h-12 bg-gradient-to-br rounded-xl shadow-lg from-primary to-secondary">
              <svg className="w-7 h-7 text-white" fill="currentColor" viewBox="0 0 24 24">
                <path d="M12 2l3.09 6.26L22 9.27l-5 4.87 1.18 6.88L12 17.77l-6.18 3.25L7 14.14 2 9.27l6.91-1.01L12 2z"/>
              </svg>
            </div>
            <div className="hidden text-left sm:block">
              <div className="text-xl font-bold leading-tight text-base-content">Vacation Planner</div>
              <div className="text-xs leading-tight text-base-content/60">AI-Powered Trip Planning</div>
            </div>
          </button>
        </div>
      </div>

      {/* Center - Desktop Navigation */}
      <div className="hidden navbar-center lg:flex">
        <ul className="gap-1 px-1 menu menu-horizontal">
          <li>
            <button
              onClick={() => navigate('/')}
              className={`gap-2 btn btn-ghost ${isActive('/') ? 'btn-active' : ''}`}
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 4.354a4 4 0 110 5.292M15 21H3v-1a6 6 0 0112 0v1zm0 0h6v-1a6 6 0 00-9-5.197m13.5-9a2.5 2.5 0 11-5 0 2.5 2.5 0 015 0z" />
              </svg>
              <span className="hidden xl:inline">Plan Trip</span>
            </button>
          </li>
          <li>
            <button
              onClick={() => navigate('/saved')}
              className={`gap-2 btn btn-ghost ${isActive('/saved') ? 'btn-active' : ''}`}
            >
              <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 5a2 2 0 012-2h10a2 2 0 012 2v16l-7-3.5L5 21V5z" />
              </svg>
              <span className="hidden xl:inline">Saved Trips</span>
            </button>
          </li>
        </ul>
      </div>

      {/* Right Side - Actions */}
      <div className="gap-2 navbar-end">
        {/* AI Ready Indicator */}
        <div className="hidden gap-2 items-center px-3 py-2 rounded-lg border md:flex bg-success/10 border-success/20">
          <div className="w-2 h-2 rounded-full animate-pulse bg-success"></div>
          <span className="text-sm font-medium text-success">AI Ready</span>
        </div>

        {/* Theme Toggle */}
        <ThemeToggle />

        {/* Mobile Menu */}
        <div className="dropdown dropdown-end lg:hidden">
          <div tabIndex={0} role="button" className="btn btn-ghost btn-square">
            <svg xmlns="http://www.w3.org/2000/svg" className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          </div>
          <ul tabIndex={0} className="dropdown-content menu bg-base-100 rounded-box z-[1] w-52 p-2 shadow-lg border border-base-300 mt-2">
            <li>
              <button
                onClick={() => {
                  navigate('/');
                  document.activeElement?.blur();
                }}
                className={`gap-2 ${isActive('/') ? 'active' : ''}`}
              >
                <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 4.354a4 4 0 110 5.292M15 21H3v-1a6 6 0 0112 0v1zm0 0h6v-1a6 6 0 00-9-5.197m13.5-9a2.5 2.5 0 11-5 0 2.5 2.5 0 015 0z" />
                </svg>
                Plan Trip
              </button>
            </li>
            <li>
              <button
                onClick={() => {
                  navigate('/saved');
                  document.activeElement?.blur();
                }}
                className={`gap-2 ${isActive('/saved') ? 'active' : ''}`}
              >
                <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 5a2 2 0 012-2h10a2 2 0 012 2v16l-7-3.5L5 21V5z" />
                </svg>
                Saved Trips
              </button>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
